def get_files(db):
    root_dir = "plan_data"
    for path, folders, files in os.walk(root_dir):
        if path.endswith("degree_requirements"):
            for file in files:
                file_name = path + "/" + file
                parse_csv(db, file_name)


def write_to_db(db, plans, lists, program_name, year):
    pass
    for term, plan in plans.items():
        if "courses" in plan:
            for course in plan["courses"]:
                entry = EngineeringDisciplineModel(
                    discipline_name=program_name,
                    course_codes=course,
                    number_of_courses=1,
                    link=link_map[program_name],
                    year=year,
                    term=term
                )
                db.add(entry)
        if "lists" in plan:
            for list in plan["lists"]:
                count = lists[list]["count"]
                if count != 0:
                    if "courses" in lists[list]:
                        courses = lists[list]["courses"]
                        print(courses)
                        entry = EngineeringDisciplineModel(
                            discipline_name=program_name,
                            course_codes=", ".join(courses),
                            number_of_courses=count,
                            link=link_map[program_name],
                            year=year,
                            term=term
                        )
                        db.add(entry)
    db.commit()


def flatten_lists(lists):
    for list in lists.values():
        if "lists" in list:
            for sublist in list["lists"]:
                # print(list)
                if sublist in lists and "courses" in lists[sublist]:
                    list["courses"] = list.get("courses", []) + lists[sublist]["courses"]
    return lists


# BME123 -> BME 123
def add_space_to_course_codes(flattened_lists):
    for f_list in flattened_lists.values():
        if "courses" in f_list:
            for course in f_list["courses"]:
                # All letters in course
                print("Course", course)
                dept_code = [char for char in course if char.isalpha()]
                course_num = [char for char in course if char.isdigit()]
                f_list["courses"].append(f"{course[0].join('')} {course_num[1].join('')}")
    return flattened_lists


