def parse_cse_csvs(db, file, cse_dict):
    year = re.search(r'\d+', file).group()
    cse_name = re.search(r'eng_cse\w+(?=__\d+\.csv)', file).group(0)
    courses = set()
    temp_dict = {}
    with open(file) as file:
        print(file)
        reader_obj = csv.reader(file)
        next(reader_obj)
        for row in reader_obj:
            # if row[0].isupper():
            course_number = re.search(r'([^*]+)\*', row[1])
            include = False if 'not' in row[0] else True
            course_number = "" if not course_number else course_number.group(1)
            course_code = ''.join(re.findall(r'[A-Z]', row[0]))
            if re.search(r'([^*]*\*|[*])', row[1]):
                query = db.query(CourseModel.course_code).filter(CourseModel.course_code.ilike(f'{course_code + course_number}%')).all()
                course_codes = [result.course_code for result in query]
                if include:
                    temp_dict[course_code] = course_codes
                else:
                    if course_code in temp_dict:
                        for code in course_codes:
                            if code in temp_dict[course_code]:
                                temp_dict[course_code].remove(code)
                    else:
                        temp_dict[row[0]] = course_codes
            else:
                if include:
                    if course_code not in temp_dict:
                        temp_dict[course_code] = [course_code + row[1]]
                    else:
                        temp_dict[course_code].append(course_code + row[1])
                else:
                    if course_code in temp_dict:
                        if course_code + row[1] in temp_dict[course_code]:
                                # print("removed", course_code + row[1])
                                temp_dict[course_code].remove(course_code + row[1])
                    else:
                        temp_dict[course_code] = [course_code + row[1]]         
        # print(temp_dict)
        for courses_list in temp_dict.values():
            courses.update(courses_list)
        # print(courses)

    if not cse_name in cse_dict:
        cse_dict[cse_name] = {year: courses}
    else:
        cse_dict[cse_name][year] = courses
    print(cse_dict)

